import './App.css';
import { createBrowserRouter,RouterProvider} from "react-router-dom";
import Navbar from './components/Navbar';
import Login from './components/Login';
import Signup from './components/Signup';
import React,{useState}from "react";
import LoadingBar from 'react-top-loading-bar';
import About from './components/About';
import Services from './components/Services';
import Contactus from './components/Contactus';
import Footer from './components/Footer';
import Welcome from './components/Welcome';
import Main from './components/Main';
import Market from './components/Market';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  document.body.style.backgroundColor="linear-gradient(white,#E0F8E7)";
  const [click,setclick]=useState(false);
  const [progress,setprogress]=useState(0);
  const handleonclicklogin=()=>{
    setclick(true);
    console.log(click);
  }
  const showalert=()=>{
    setTimeout(()=>{
      setprogress(20);
    },100)
    setTimeout(()=>{
      setprogress(40);
    },200)
    setTimeout(()=>{
      setprogress(60);
    },300)
    setTimeout(()=>{
      setprogress(80);
    },400)
    setTimeout(()=>{
      setprogress(100);
    },500)
  }
  const handleonClick2=()=>{
    showalert();
  }

  const router=createBrowserRouter([
    {
      path:"/",
    element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Welcome click={click} handleonclicklogin={ handleonclicklogin} /><Footer/></>
    },
    {
      path:"/home",
    element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Main/><Footer/></>
    },
    {
      path:"/about",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><About/><Footer/></>
    },
    {
      path:"/services",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Services/><Footer/></>
    },
    {
      path:"/contactus",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Contactus/><Footer/></>
    },
    {
      path:"/market",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      />
      <div className="container my-4" style={{display:"flex",justifyContent:"center",alignItems:"center",flexWrap:"wrap",rowGap:"20px",columnGap:"20px"}}>
      <Market img={"./img1.jpg"}name={"hello"} title={"hello2"}/>
      <Market img={"./img2.jpg"}name={"hello"} title={"hello2"}/>
      <Market img={"./img3.jpg"}name={"hello"} title={"hello2"}/>
      <Market img={"./img4.jpg"}name={"hello"} title={"hello2"}/>
      <Market img={"./img5.jpg"}name={"hello"} title={"hello2"}/>
      <Market img={"./img6.jpg"}name={"hello"} title={"hello2"}/>
      </div>
      <Footer/></>
    },
    {
      path:"/login",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Login/><Footer/></>
    },
    {
      path:"/signup",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Signup/><Footer/></>
    }
  ])

  return (
    <>
    <RouterProvider router={router}/>
    </>
  );
}

export default App;
